axios.defaults.baseURL = 'http://127.0.0.1:8000/';

export class Contact extends React.Component {


render() {


    return (
        <>
        <PhoneOutlined/>
        <div>{this.props.data.tele}</div>
        <Spacer amount={5} />
        <MailOutlined/>
        <div>{this.props.data.email}</div>
        <Spacer amount={5} />
        <HomeOutlined/>
        <div>{this.props.data.office}</div>
        </>
    )
}

}

  export default Contact;
